        class=\"gf-reorder-btn SP_menu_button\"></div>\n</div>\n<div class=sfe-section>\n<div
        class=companySummary>\nApple Inc. (Apple) designs, manufactures and markets
        mobile communication and media devices, personal computers, and portable digital
        music players, and a variety of related software, services, peripherals, networking
        solutions, and third-party digital content and applications. The Company's
        products and services include iPhone, iPad, Mac, iPod, Apple TV, a portfolio
        of consumer and professional software applications, the iOS and OS X operating
        systems, iCloud, and a variety of accessory, service and support offerings.
        The Company also delivers digital content and applications through the iTunes
        Store, App StoreSM, iBookstoreSM, and Mac App Store. The Company distributes
        its products worldwide through its retail stores, online stores, and direct
        sales force, as well as through third-party cellular network carriers, wholesalers,
        retailers, and value-added resellers. In February 2012, the Company acquired
        app-search engine Chomp.\n<div class=sfe-break-top>\n<a id=m-rprofile href=//www.google.com/url?source=finance&q=http%3A%2F%2Fstocks.us.reuters.com%2Fstocks%2FfullDescription.asp%3Frpc%3D66%26symbol%3DAAPL.O&ei=T9PvVLDnAunxsAeEoIDgBg&usg=AFQjCNF7hO_sKOf8KqdWDsqEzA9F7G7HGw
